import { FormLabel, Select } from "@chakra-ui/react"

const YearInput = () => {
    return (
        <>
            <FormLabel>Country</FormLabel>
            <Select placeholder="Select country">
                <option>United Arab Emirates</option>
                <option>Nigeria</option>
            </Select>
        </>
    )
}

export default YearInput
